import React from 'react';
import ReactDOM from "react-dom";
import './index.css';
function App(){
  return <div>
    <h1>Useful websites</h1>
    <h3>Browse any website you want.</h3>
  </div>
}
ReactDOM.render(<App/>,document.getElementById("root"));
